.categories figure figcaption::before,
.categories figure figcaption::after {
  position: absolute;
  top: 30px;
  right: 30px;
  bottom: 30px;
  left: 30px;
  content: "";
  opacity: 0;
  transition: opacity 0.5s, transform 0.5s;
}
