  transition: opacity 0.5s, transform 0.5s;
  transform: translate3d(0, 20px, 0);
}
.categories figure:hover img {
  opacity: 0.1;
}
.categories figure:hover figcaption::before,
.categories figure:hover figcaption::after {
  opacity: 1;
  transform: scale(1);
}
